import React from "react";
import { NavLink } from "react-router-dom";




const Sidebar = () => {

    return (
        <div className="aside_bar">
            <NavLink className="nav_buttons" to=""><i className="address book outline icon"></i>My Anonymous</NavLink>
            <NavLink className="nav_buttons" to=""><i className="newspaper outline icon"></i>AnoNews</NavLink>
            <NavLink className="nav_buttons" to="">Letters</NavLink>
            <NavLink className="nav_buttons" to="">My Anonymous Group</NavLink>
            <NavLink className="nav_buttons" to="">Groups</NavLink>
            <NavLink className="nav_buttons" to="">Secret(Photos)</NavLink>
            <NavLink className="nav_buttons" to="">Free Music</NavLink>
            <NavLink className="nav_buttons" to="">Video - "How to break Pentagon"</NavLink>
        </div>
    )
}


export default Sidebar
